import { Component } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-enroll',
  templateUrl: './participant-eventenroll.component.html',
  styleUrls: ['./participant-eventenroll.component.css']
})
export class EnrollComponent {
  participantId: number | null = null;
  eventId: number | null = null;
  loading = false;
  message = '';

  constructor(private http: HttpClient) {}

  enroll() {
    if (!this.participantId || !this.eventId) {
      this.message = 'Please select both participant and event.';
      return;
    }

    this.loading = true;
    this.http.post(`http://localhost:5070/api/Participants/${this.participantId}/Enroll/${this.eventId}`, {})
      .subscribe({
        next: (res: any) => {
          this.message = res.message || 'Enrollment successful';
          this.loading = false;
        },
        error: (err) => {
          console.error('Error enrolling:', err);
          this.message = 'Enrollment failed. Please try again.';
          this.loading = false;
        }
      });
  }
}
<div class="page-container">
  <h2>Enroll in Event</h2>

  <form (ngSubmit)="enroll()">
    <div class="form-group">
      <label for="participantId">Select Participant</label>
      <select [(ngModel)]="participantId" name="participantId" required>
        <option value="" disabled selected>Select a participant</option>
        <option *ngFor="let p of participants" [value]="p.participantId">
          {{ p.participantId }} - {{ p.name }}
        </option>
      </select>
    </div>

    <div class="form-group">
      <label for="eventId">Select Event</label>
      <select [(ngModel)]="eventId" name="eventId" required>
        <option value="" disabled selected>Select an event</option>
        <option *ngFor="let e of events" [value]="e.eventId">
          {{ e.eventId }} - {{ e.title }}
        </option>
      </select>
    </div>

    <button type="submit" [disabled]="loading">
      {{ loading ? 'Enrolling...' : 'Enroll' }}
    </button>
  </form>

  <p class="message">{{ message }}</p>
</div>
